class Solution {
  List<int> lexicographicallySmallestArray(List<int> nums, int limit) {
    bool swapped;
    do {
      swapped = false;
      for (int i = 0; i < nums.length - 1; i++) {
        int minVal = nums[i];
        int minIdx = i;
        for (int j = i + 1; j < nums.length && j <= i + limit; j++) {
          if (nums[j] < minVal) {
            minVal = nums[j];
            minIdx = j;
          }
        }
        if (minIdx != i) {
          int temp = nums[i];
          nums[i] = nums[minIdx];
          nums[minIdx] = temp;
          swapped = true;
        }
      }
    } while (swapped);
    return nums;
  }
}
